function H1(props){

	const { data, update, index } = props

	return (<h1><input type="text" value={props.data.value} onChange={(e)=>{
		let l = {...props.data}
		l.value = e.target.value
		update(index, l)
	}}/></h1>)
}


export const h1Template = { type:"quiz", title:"TITLE", questions:[{q:"question",a:"answer", ref:"bible reference"}]}
export default H1;
